import React, { useEffect, useState } from 'react';

import { echo } from './Brodscat';

function App() {
  const [data, setData] = useState([]);

  const echoNotification = () => {
    echo
    .channel('chats.1')
    .listen('ChatMessageCreated', ev => {
      let values = data;
      values.push(ev.message)
      setData(values);
    });
  };

  useEffect(() => {
    echoNotification();
  }, []);

  useEffect(() => {
    console.log(data);
  }, [data]);

  return (
    <div className="App">
      <h1>Teste</h1>
    </div>
  );
}

export default App;
